import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Users from './users/pages/Users';

function App() {
  return <Router>
  	<Routes>
  		<Route path='/'>
  			<Users />
  		</Route>
  	</Routes>
  </Router>
}

export default App;
